  base: *id012
  body: "Fixes a bug with deepcopy of object arrays in F-order:\n\n```\nIn [1]: import\
    \ numpy as np\n\nIn [2]: np.__version__       \nOut[2]: '1.11.0.dev0+9cc55dc'\n\
    \nIn [3]: a = {'a': 1}\n\nIn [4]: b = {'b': 2}\n\nIn [5]: np.array([[a, b], [a,\
    \ b]], order='F')\nOut[5]: \narray([[{'a': 1}, {'b': 2}],\n       [{'a': 1}, {'b':\
    \ 2}]], dtype=object)\n\nIn [6]: import copy\n\nIn [7]: copy.deepcopy(np.array([[a,\
    \ b], [a, b]], order='F'))\nOut[7]: \narray([[{'a': 1}, {'a': 1}],\n       [{'b':\
    \ 2}, {'b': 2}]], dtype=object)\n```\n\nThis was discovered as part of a bug found\
    \ with [biggus](https://github.com/SciTools/biggus) in https://github.com/SciTools/biggus/issues/157.\n"
